async function submitCampaign(body){
    const response =
      await fetch( "http://localhost:3004/posts",
        { 
          method: 'post',
          headers: {'Content-Type':'application/json','Accept': 'application/json'},
          body: JSON.stringify(body)
        }
      )
    return await response;
  }
  export {submitCampaign}
